import logo from '../../static/KPMG_logo_white.svg';
// import upload_icon from '../../static/upload.png';
import React from 'react';


export default function UploadBar() {

    return (
        <div className='uploadbar_container'>
            <div style={{position: 'relative', height:'5%'}}><img src={logo} alt='kpmg_logo' style={{ width: '80px', float: 'left' }} /></div>
            <div className='container_div' style={{position: 'relative', height:'20%'}}>
                <input accept="*" style={{display:'none'}} id="upload-btn" multiple type="file" />
                <label htmlFor="upload-btn"><button style={{backgroundColor:'transparent', border:'none'}}>UPLOAD</button></label>
            </div>
            <div className='container_div' style={{position: 'relative', height:'70%'}}></div>
        </div>
    );
};
